CREATE DATABASE capullitos;
USE capullitos;
CREATE TABLE `agendadaycare` (
  `id` int(100) NOT NULL,
  `entrada` varchar(20) NOT NULL,
  `salida` varchar(20) NOT NULL,
  `dia` date NOT NULL,
  `costo` varchar(50) NOT NULL,
  `horas` varchar(50) NOT NULL,
  `email` varchar(150) NOT NULL,
  `asociado` int(50) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE `formaunica` (
  `id` int(6) NOT NULL,
  `nombre` varchar(191) DEFAULT NULL,
  `apellidop` varchar(191) DEFAULT NULL,
  `apellidom` varchar(191) DEFAULT NULL,
  `direccion` varchar(191) DEFAULT NULL,
  `quien` varchar(191) DEFAULT NULL,
  `observaciones` varchar(191) DEFAULT NULL,
  `nombrepmtuno` varchar(191) DEFAULT NULL,
  `teluno` varchar(191) DEFAULT NULL,
  `emailuno` varchar(191) DEFAULT NULL,
  `nombrepmtdos` varchar(191) DEFAULT NULL,
  `teldos` varchar(191) DEFAULT NULL,
  `emaildos` varchar(191) DEFAULT NULL,
  `nombremergencia` varchar(191) DEFAULT NULL,
  `telemergencia` varchar(191) DEFAULT NULL,
  `relacion` varchar(191) DEFAULT NULL,
  `direccionemergencia` varchar(191) DEFAULT NULL,
  `nombremergenciados` varchar(191) DEFAULT NULL,
  `telemergenciados` varchar(191) DEFAULT NULL,
  `relaciondos` varchar(191) DEFAULT NULL,
  `direccionemergenciados` varchar(191) DEFAULT NULL,
  `nombremergenciatres` varchar(191) DEFAULT NULL,
  `telemergenciatres` varchar(191) DEFAULT NULL,
  `relaciontres` varchar(191) DEFAULT NULL,
  `direccionemergenciatres` varchar(191) DEFAULT NULL,
  `doctor` varchar(191) DEFAULT NULL,
  `teldoc` varchar(191) DEFAULT NULL,
  `direcciondoc` varchar(191) DEFAULT NULL,
  `dentista` varchar(191) DEFAULT NULL,
  `teldent` varchar(191) DEFAULT NULL,
  `direcciondent` varchar(191) DEFAULT NULL,
  `trasladar` varchar(191) DEFAULT NULL,
  `ssn` varchar(191) DEFAULT NULL,
  `autorizado` varchar(191) DEFAULT NULL,
  `telauto` varchar(191) DEFAULT NULL,
  `relacionauto` varchar(191) DEFAULT NULL,
  `autorizadodos` varchar(191) DEFAULT NULL,
  `telautodos` varchar(191) DEFAULT NULL,
  `relacionautodos` varchar(191) DEFAULT NULL,
  `fechaNac` date DEFAULT NULL,
  `edad` int(100) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;


CREATE TABLE `marketing` (
  `id` int(6) NOT NULL,
  `nombre` varchar(191) DEFAULT NULL,
  `apellido` varchar(191) DEFAULT NULL,
  `email` varchar(191) DEFAULT NULL,
  `telefono` varchar(25) DEFAULT NULL,
  `paquete` varchar(191) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;


CREATE TABLE `user` (
  `id` int(100) NOT NULL,
  `rol` int(100) NOT NULL,
  `username` varchar(191) DEFAULT NULL,
  `password` varchar(2000) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;


ALTER TABLE `agendadaycare`
  ADD PRIMARY KEY (`id`);

ALTER TABLE `formaunica`
  ADD PRIMARY KEY (`id`);

ALTER TABLE `marketing`
  ADD PRIMARY KEY (`id`),
  ADD UNIQUE KEY `telefono` (`telefono`);

ALTER TABLE `user`
  ADD PRIMARY KEY (`id`);

ALTER TABLE `agendadaycare`
  MODIFY `id` int(100) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=9;

ALTER TABLE `formaunica`
  MODIFY `id` int(6) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=106;

ALTER TABLE `marketing`
  MODIFY `id` int(6) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=591;

ALTER TABLE `user`
  MODIFY `id` int(100) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=4;